The present invention relates to a process for blow-molding a container, the container comprising a handle, whereby the process comprises the steps of:
 (i) introducing a preform (2) into a mold cavity and stretching the preform (2) with a stretch rod; (ii) increasing the pressure within the preform (2) so that the preform (2) expands within the mold cavity in a first blowing step, the pressure in the first blowing step is from 1 to 10 bar; (iii) inwardly moving jaws (3, 4) within the mold cavity so that the expanding preform (2) is partially gripped and fused (10) between the jaws in the handle region; (iv) subsequently increasing the pressure within the preform (2) wherein the maximum pressure in the second blowing step is greater than 10 bar, so that the preform (2) expands to the limits of the mold cavity in a second blowing step to form a container; 
and wherein the inward movement of the jaws (3, 4) is completed within the first blowing step. The present invention further relates to a blow-molded container (20) comprising biorientated polypropylene comprising a main bottle cavity (21) and an integrally molded, hollow handle cavity (22), and wherein the main bottle cavity (21) and the hollow handle cavity (22) are interconnected such that fluid can flow freely between the two cavities (21, 22).

The present invention relates to a process for blow-molding a container, the container comprising a handle, whereby the process comprises the steps of:
 (i) introducing a thermoplastic preform (2) into a mold cavity (6) and stretching the preform (2) with a stretch rod (3); (ii) increasing the pressure within the preform (2) so that the preform (2) expands within the mold cavity (6); (iii) displacing at least one moving mold section within the mold and which deforms the thermoplastic material; 
wherein the displacement of the moving section is in a direction which is substantially parallel to the direction of movement of the stretch rod (3).

The present invention relates to process for forming a container by stretching and blow-molding a preform within a mold cavity comprising the steps of:
 (i) introducing a preform into the mold cavity and stretching the preform with a stretch rod; (ii) increasing the pressure within the preform so that the preform expands within the mold cavity in a blowing step; (iii) at least one inwardly moving mold section within the mold cavity so that the expanding preform is deformed by the inwardly moving mold section; 
wherein the glass transition temperature (Tg) of the preform material is at least 10°C below the temperature of the walls of the mold cavity. The present invention further relates to a stretch blow molded container comprising walls of a thermoplastic polyolefin, the thermoplastic polyolefin having a glass transition temperature of less than 30°C and wherein the container has a degree of asymmetry of at least 1.5.

The present invention relates to process for forming a container by stretching and blow-molding a preform within a mold cavity comprising the steps of: 
(i) introducing a preform into the mold cavity and stretching the preform with a stretch rod; 
(ii) increasing the pressure within the preform so that the preform expands within the mold cavity in a blowing step; 
(iii) at least one inwardly moving mold section within the mold cavity so that the expanding preform is deformed by the inwardly moving mold section; 
wherein the glass transition temperature (Tg) of the preform material is at least 10°C below the temperature of the walls of the mold cavity. The present invention further relates to a stretch blow molded container comprising walls of a thermoplastic polyolefin, the thermoplastic polyolefin having a glass transition temperature of less than 30°C and wherein the container has a degree of asymmetry of at least 1.5.

The present invention relates to a process for making a container having an integral handle, comprising the steps of: 
a) providing a preform (6) in a mould cavity (1); 
b) stretch-blow moulding the preform (6) to form an intermediate container (8) which comprises at least one, preferably two, convex bubble(s) (9); 
c) deforming the or each convex bubble (9) by means of an inwardly moving plug (5) to form one or more concave gripping region(s), whilst maintaining the pressure within the intermediate container (8) above 1 bar and whilst the temperature of the material in the gripping region of the intermediate container is maintained at a temperature between the glass transition temperature, T g , and the melt temperature, T m ; 
d) releasing excess pressure within the container, preferably prior to withdrawing the plug (5) from within the container; and 
c) ejecting the finished container from the mould cavity (1, 3).
